DROP TABLE IF EXISTS zones_to_post_code_es;
CREATE TABLE IF NOT EXISTS zones_to_post_code_es (
  post_zone_id int NOT NULL AUTO_INCREMENT,
  zone_country_id int NOT NULL DEFAULT '195',
  zone_id int NOT NULL DEFAULT '0',
  post_code varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  zone_name varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  zone_city_name varchar(80) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  PRIMARY KEY (post_zone_id),
  UNIQUE KEY post_code_2 (post_code,zone_city_name,zone_name),
  KEY post_code (post_code),
  KEY zone_id (zone_id),
  KEY zone_name (zone_name)
) ENGINE=MyISAM AUTO_INCREMENT=37868 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

